//! == Import : npm ==
import React from 'react';

//! == Import : local ==
import './styles.scss';

//! == Composant ==
const Command = () => (
    <div className="command">
        background: vars.$color-lightness;
        border-radius: .5rem;
        padding: 2rem;
        box-shadow: inset 0 0 15px 5px vars.$color-primary;
    </div>
);

//! == Export ==
export default Command;
